import {
    Button,
    StyleSheet,
    Text,
    View,
    ScrollView,
    SafeAreaView,
    StatusBar,
    Dimensions,
    FlatList,
} from "react-native";
import TestButtons from "./testComponents/TestButtons";
import HabitBox from "./HabitBox";
import HabitBoxes from "./testComponents/HabitBoxes";
// TODO: The scrollable should keep scrolling for a little longer
function HabitPage() {
    const data = [
        <HabitBox color={"tomato"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"blue"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"navy"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"green"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"red"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(200,0,200)"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(0,200,200)"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(200,200,0)"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(100,0,100)"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(0,200,100)"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(200,0,100)"} name={"Ostesovs"} count={"to"} />,
        <HabitBox color={"rgb(100,0,200)"} name={"Ostesovs"} count={"to"} />,
    ];
    return (
        <View style={{ flex: 1 }}>
            <StatusBar />
            <FlatList data={data} renderItem={({ item }) => item} />
            {/* <ScrollView
                style={{ flex: 1 }}
                contentContainerStyle={styles.scrollview}
            >
                <View style={styles.container}>
                    <HabitBoxes style={styles.container} />
                </View>
            </ScrollView> */}
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: "row",
        justifyContent: "flex-start",
        flexWrap: "wrap",
    },
    scrollview: {
        justifyContent: "flex-start",
        flexDirection: "row",
        gap: 20,
    },
});
export default HabitPage;
